import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import FeedPage from "./pages/feed";

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" component={FeedPage} />
      </Switch>
    </BrowserRouter>
  )
}

export default App;
